import "./Aside.scss" 
import Dialogs from "./Dialogs/Dialogs";
import Message from "./Message/Message";
import { BrowserRouter, Route} from "react-router-dom";



const Aside=(props)=>{
    let DialogsData=[
        {id:1,name:"Андрей"},
        {id:2,name:"Артём"},
        {id:3,name:"Егор"},
        {id:5,name:"Вадим"},
        {id:6,name:"Ваня"},
        {id:7,name:"хз какой-то ноунейм"},
        {id:8,name:"хз какой-то ноунейм"},
      ]
    return(
        <BrowserRouter>
        <div className="Aside">
        <Dialogs DialogsData={props.DialogsData}></Dialogs>
        <Message MessagesData={props.MessagesData}></Message>
        </div>
        </BrowserRouter>
    );
}

export default Aside
